oxy_webhelp_navlinks = {"workflow_for_azure_cloud_cluster_es-d22908e1602":{"topics":[{"title":"Provisioning an Azure Cloud Cluster ES","shortdesc":"<p class=\"shortdesc\">You can provision and deploy Rubrik Cloud Cluster Elastic Storage for Azure from <span class=\"ph\">RSC<\/span> to run a virtual Rubrik cluster that protects applications and data         within a Microsoft Azure virtual network.<\/p>","href":"saas\/provisioning_azure_cc_es.html","attributes":{"data-id":"provisioning_azure_cc_es"},"menu":{"hasChildren":false},"tocID":"provisioning_azure_cc_es-d22908e1616","topics":[]},{"title":"Enabling version-level immutability when creating a container in Azure","shortdesc":"<p class=\"shortdesc\">When you are creating a container in Azure, to use immutability to back up and         preserve data on the Rubrik Cloud Cluster ES, enable version-level immutability on the         container.<\/p>","href":"saas\/azr_enabling_immutability_new_container.html","attributes":{"data-id":"azr_enabling_immutability_new_container"},"menu":{"hasChildren":false},"tocID":"azr_enabling_immutability_new_container-d22908e1630","topics":[]},{"title":"Enabling version-level immutability when editing a container in Azure","shortdesc":"<p class=\"shortdesc\">To use immutability to back up and preserve data for a container in Azure, enable the         container to support version-level immutability.<\/p>","href":"saas\/azr_enabling_immutability_editing_container.html","attributes":{"data-id":"azr_enabling_immutability_editing_container"},"menu":{"hasChildren":false},"tocID":"azr_enabling_immutability_editing_container-d22908e1641","topics":[]},{"title":"Immutability support for Cloud Cluster ES","shortdesc":"<p class=\"shortdesc\"><span class=\"ph\">Rubrik Security Cloud<\/span> supports enabling immutability when provisioning an AWS or         Azure Cloud Cluster Elastic Storage.<\/p>","href":"saas\/cloud_cluster_es_immutability_support.html","attributes":{"data-id":"cloud_cluster_es_immutability_support"},"menu":{"hasChildren":false},"tocID":"cloud_cluster_es_immutability_support-d22908e1652","topics":[]},{"title":"Upgrading Azure CCES clusters to use PremiumV2_LRS disks","shortdesc":"<p class=\"shortdesc\">Upgrade existing CCES clusters for Azure from PremiumV1_LRS disks to PremiumV2_LRS         disks using the upgrading disks workflow.<\/p>","href":"saas\/upgrading_disks_azure_cces.html","attributes":{"data-id":"upgrading_disks_azure_cces"},"menu":{"hasChildren":false},"tocID":"upgrading_disks_azure_cces-d22908e1665","topics":[]},{"title":"Limitations on upgrading disks for Azure CCES","shortdesc":"<p class=\"shortdesc\">Azure CCES PremiumV2_LRS functions as a staging disk. A staging disk has certain         restrictions involving OS disk use, region support, supported software versions and zones,         and node limits.<\/p>","href":"saas\/limitations_upgrading_disks_azure_cces.html","attributes":{"data-id":"limitations_upgrading_disks_azure_cces"},"menu":{"hasChildren":false},"tocID":"limitations_upgrading_disks_azure_cces-d22908e1676","topics":[]}]}};